import React, { FC, useState, useEffect } from 'react';

import './App.css';
import axios from "axios";
import CardCar from './components/CardCar/CardCar';


function App() {
  let url = "https://baza-gai.com.ua/nomer/KA0007XB";
  let key = "dcb856e75162ec68a57c4e5f54f430ca";

  interface Car {
    comments: string[];
    digits: string;
    is_stolen: boolean;
    model: string;
    model_year: number;
    operations: Array<any>;
    photo_url: string;
    region: {
      name: string;
      name_ua: string;
      slug: string;
      old_code: string;
      new_code: string;
    };
    stolen_details: any;
    vendor: string;
    vin: string;
  }


  const [cars, setCars] = useState<Car[]>([]);

  useEffect(() => {
    axios.get(url, 
    {
      headers: {
        "Accept": "application/json",
        "X-Api-Key": key
    }
    }).then(response => {
            setCars(response.data);

         })
   }, []);

    const carPhotoUrl = cars.length > 0 ? cars[0].photo_url : '';
    console.log(carPhotoUrl);
  return (
    <div className="App">

      <CardCar img = {carPhotoUrl}></CardCar>
    </div>
  );
}

export default App;
